response:
\boxed{1940} 

Rozwiązanie: Całkowita liczba sposobów wyboru 5 członków z 14 wynosi C(14,5). Aby wykluczyć kompozycje złożone wyłącznie z Republikanów lub wyłącznie z Demokratów, musimy odjąć C(8,5) (tylko Republikanie) oraz C(6,5) (tylko Demokraci). Stąd liczba pożądanych sposobów wynosi: 

C(14,5) - C(8,5) - C(6,5) = 2002 - 56 - 6 = 1940.
